webpackJsonp([0x81b8806e4260],{553:function(e,a){e.exports={data:{authors:{edges:[{node:{id:"eddie",name:"Eddie Lee",image:"/images/eddielee.jpg",url:"https://twitter.com/eddielee6",bio:"Father and Software Engineer"}}]}},pathContext:{nodes:[{node:{frontmatter:{title:"American Pie 2",tags:["film"],cover:"/images/american-pie-2-banner.jpg",date:"2018-10-20T22:39",author:"eddie"},fields:{slug:"/american-pie-2"},html:'<img src="/images/american-pie-2.jpg" alt="American Pie 2">\nThis will always be one of my favourite movies of all time.',timeToRead:1}},{node:{frontmatter:{title:"Everywhere",tags:["music"],cover:"https://unsplash.it/1152/300/?random?everywhere",date:"2018-10-20T22:16",author:"eddie"},fields:{slug:"/everywhere"},html:'<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 56.25%; position: relative; height: 0; overflow: hidden;"\n          >\n            <iframe src="https://www.youtube.com/embed/HLCasyAh7ic?rel=0" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n          </div>\n          </div>',timeToRead:1}},{node:{frontmatter:{title:"Introducing Drank",tags:["app","drank","drink","Glass Umbrella","health"],cover:"/images/get-drank-banner.jpg",date:"2018-07-14T11:03",author:"eddie"},fields:{slug:"/introducing-drank"},html:'<p>How much Caffeine did you drink yesterday? How many units of alcohol did you consume last weekend? Did you drink enough water today? The answer to these questions for a lot of people is often too much of the bad stuff, and not enough of the good stuff.</p>\n<p><img src="/images/drank-woman-drink.png" alt="Woman using the Drank app"></p>\n<p>Using <a href="https://itunes.apple.com/gb/app/drank/id1224749685?mt=8&#x26;ct=eddieleeme">the Drank app</a> over the last few months has allowed me to improve the balance of what I drink. I knew I drank a lot of caffeine, but until I saw it charted in Drank I wasn’t aware it was over 80% of my daily water intake, sometimes drinking in excess of 10 cups a day.</p>\n<p>Today we’re proud to release Drank to the world!</p>\n<p>Give Drank a go. Gain insights, and drink better.</p>\n<p>Available now for iOS and coming soon for Android.</p>\n<p><a href="https://itunes.apple.com/gb/app/drank/id1224749685?mt=8&#x26;ct=eddieleeme"><img src="/images/download-app-store.png" alt="Download on the App Store"></a></p>',timeToRead:1}},{node:{frontmatter:{title:"Fathers Day",tags:["personal","family"],cover:"/images/fathers-day-banner.jpg",date:"2018-06-17T22:44",author:"eddie"},fields:{slug:"/fathers-day"},html:'<p>Fathers Day in so many respects is such contrived bullshit; but I love it. Not for gifts or a lazy day - for little things, like the kids running in to wake me up; making sure I haven\'t forgotten it\'s Fathers Day. Bringing me handmade cards, funny cards, personalised gifts, and fun activities to do together.</p>\n<p>Fathers Day is great!</p>\n<p>This photo frame really made my day!\n<img src="/images/fathers-day-photo-frame.jpg" alt="Fathers Day Photo Frame"></p>\n<table class="image-split">\n    <tr>\n        <td colspan="2">\n            Ethan\'s card to himself is fantastic!\n        </td>\n    </tr>\n    <tr>\n        <td>\n            <img src="/images/fathers-day-ethan-card-1.jpg" alt="Fathers Day Card">\n        </td>\n        <td>\n            <img src="/images/fathers-day-ethan-card-2.jpg" alt="Fathers Day Card Inside">\n        </td>\n    </tr>\n</table>\n<p>Handmade cards really are awesome!!\n<img src="/images/fathers-day-kids-cards.jpg" alt="Fathers Day Cards"></p>\n<p>And I cannot wait to set this hydraulic arm up with Ethan! We\'re going to have so much fun with it!!\n<img src="/images/fathers-day-arm.jpg" alt="Hydraulic Arm"></p>\n<p>My kids are awesome!!</p>',timeToRead:1}},{node:{frontmatter:{title:"Post Traumatic",tags:["music","Post Traumatic","Linkin Park","Mike Shinoda"],cover:"/images/post-traumatic-cover.jpg",date:"2018-06-16T21:01",author:"eddie"},fields:{slug:"/post-traumatic"},html:'<p>The new album; Post Traumatic by Mike Shinoda is absolutely fantastic. Some of his solo work in the past has been pretty good, but every single track on this album is unquestionably excellent!!</p>\n<p>It really fucking sucked when Chester died last year - this album is a very raw show of grief layed out as the album progresses. Well worth a listen...</p>\n<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 68.18181818181817%; position: relative; height: 0; overflow: hidden;"\n          >\n            <iframe allow="autoplay *; encrypted-media *;" frameborder="0" sandbox="allow-forms allow-popups allow-same-origin allow-scripts allow-top-navigation-by-user-activation" src="https://embed.music.apple.com/ca/album/post-traumatic/1362650343" style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n          </div>\n          </div>',timeToRead:1}}],page:1,pages:10,total:48,limit:5,next:"/2"}}}});
